import React from "react";
import "./Latest.scss";

interface LatestProps {
    image: string;
    creditPerson?: string;
    creditWebsite?: string;
    creditLink?: string;
    header: string;
    authorImage?: string;
    authorLink?: string;
    authorName?: string;
    content: string;
    articleLink: string;
}

const defaultProps = {
    creditPerson: "Mark Alfred",
    creditWebside: "Daily Nexus",
    creditLink: "https://dailynexus.com/",
    authorImage: "./../../images/MarkProfile.jpg",
    authorLink: "https://dailynexus.com/author/markalfred/",
    authorName: "Mark Alfred",
};

const Latest = (LatestProps: LatestProps) => {
    const {
        image,
        creditPerson,
        creditWebside,
        creditLink,
        header,
        authorImage,
        authorLink,
        authorName,
        content,
        articleLink,
    } = { ...defaultProps, ...LatestProps };
    return (
        <div className="Latest">
            <div className="Latest-Tab"></div>
            <div className="Latest-Image-Container">
                <img className="Latest-Image" src={image} alt="" />
                <p className="Latest-Image-Credit">{creditPerson} / </p>
                <a className="Latest-Image-Credit-Site" href={creditLink}>
                    {creditWebside}
                </a>
            </div>
            <div className="Latest-Article">
                <h2 className="Latest-Header">{header}</h2>
                <div className="Latest-Author">
                    <img
                        className="Latest-Author-Image"
                        src={require(`../../assets/${data[counter].image}.jpg`)}
                        alt=""
                    />
                    <p>By</p>
                    <a href={authorLink}>{authorName}</a>
                </div>
                <p className="Latest-Body">{content}</p>
            </div>
            <div className="Latest-ReadMore">
                <a href={articleLink}>Read More</a>
            </div>
        </div>
    );
};

export default Latest;
